function headerbg() {
    var scroll = $(window).scrollTop();
    if (scroll >= 100) {
        $("header").addClass("header-bg");
    } else {
        $("header").removeClass("header-bg");
    }
}

$(window).scroll(function() {
    headerbg();
});



